import React from 'react';
import Button from '../Button/Button';
import Footer from '../Footer/Footer';
import Menu from '../Menu/Menu';
import Header from '../Header/Header';

const App = () => {
  return(
    <div>
        <Button/>
        <Menu/>
        <Header/>
        <Footer/>
    </div>
  )
}

export default App;
